import axios from 'axios'
import {connect} from 'react-redux'


const mapStateToProps = (state) => {
    return {
        token : state.user.token
    }
}

export default connect()(axios.create({
        baseURL:"http://localhost:8081",
        headers:{
            token:this.props.token
        }
    }));
